import React, { useRef, useEffect } from 'react';
import { FaGithub, FaLinkedin } from "react-icons/fa";
import Avatar from '../assets/Software.png';
import VideoBackground from '../assets/beach-isla.mp4';  // Import the video

const Body = () => {
    const videoRef = useRef(null);

    // Adjust the playback rate when the component mounts
    useEffect(() => {
      if (videoRef.current) {
        videoRef.current.playbackRate = 0.24; // Adjust this value to slow down or speed up the video
      }
    }, []);

    return (
    <div id="body" className="body">
      <div className="body-container">
        {/* Video Background */}
        <video  src={VideoBackground} autoPlay loop muted className="video-background" ref={videoRef}>
        </video>

        <div className="body-profile">
          <img className="body-img" alt='avatar' src={Avatar} />

          <div className="body-content">
            <div className="body-headline">Sathwik Kesappragada</div>
            <div className="body-text">Data Analyst</div>
          </div>

          <div className="body-icons">
            <a href="https://www.educative.io/" target="_blank" rel="noreferrer" className="icon-link"><i><FaGithub /></i> </a>
            <a href="https://www.educative.io/" target="_blank" rel="noreferrer" className="icon-link"><i><FaLinkedin /></i></a>
          </div>
        </div>
      </div>
    </div>
  )
}

export default Body;
